export default {
    data: [
        {
            "id": 0,
            "value": "accId",
            "type": "String(64)",
            "required": "M",
            "desc": "PingPong定义的商户店铺唯一编号"
        },
        {
            "id": 1,
            "value": "disputePspReference",
            "type": "String(256)",
            "required": "M",
            "desc": "拒付单号"
        },
        {
            "id": 2,
            "value": "defenseComment",
            "type": "String(1024)",
            "required": "O",
            "desc": "抗辩理由和描述"
        },
        {
            "id": 3,
            "value": "defenseDocuments",
            "type": "Array",
            "required": "O",
            "desc": "材料列表",
            "children": [
                {
                    "id": 30,
                    "value": "content",
                    "type": "String",
                    "required": "M",
                    "desc": "上传材料的base64"
                },
                {
                    "id": 31,
                    "value": "contentType",
                    "type": "String",
                    "required": "M",
                    "desc": "文件类型，可选值为jpg/png/pdf"
                },
                {
                    "id": 32,
                    "value": "contentName",
                    "type": "String",
                    "required": "M",
                    "desc": "上传文件名称，注:文件名称不可重复，否则会被覆盖"
                },
                {
                    "id": 33,
                    "value": "defenseDocumentTypeCode",
                    "type": "String(256)",
                    "required": "M",
                    "desc": "拒付申诉文件种类，详情见枚举:<br/><a href=\"/pages/49d7ed/\" target=\"_blank\">CBDocTypeCodeEnum</a>"
                }]
        },
        {
            "id": 4,
            "value": "ItemName",
            "type": "String(256)",
            "required": "O",
            "desc": "物品名称"
        },
        {
            "id": 5,
            "value": "recieverName",
            "type": "String(64)",
            "required": "O",
            "desc": "收货人/玩家昵称(游戏)"
        }
    ]
}
